/* eslint-disable react/no-array-index-key */
/* eslint-disable react/button-has-type */
/* eslint-disable react/self-closing-comp */
import React, { useState } from 'react';
import { useSelector } from 'react-redux';

const Dashboard = () => {
    const selectedVehiclesIds = useSelector((state) => state.map.selectedVehiclesIds);
    const [btnText, setbtnText] = useState('Select Area');
    const handleClick = () => {
      console.log('draw poly');
    };

    return (
      <div className="dashboard">
        <div className="dashboard-header">
          <h4>Vehicles in selected area:</h4>
          <button onClick={handleClick}>Draw Selection Area</button>
        </div>
        <div className="ids-list">
          {selectedVehiclesIds.map((id, index) => <p key={index}>{id}</p>)}
        </div>
      </div>
    );
};

export default Dashboard;
